import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Table, Button, Modal, Form } from 'react-bootstrap';

const Zone = () => {
  const [zones, setZones] = useState([]);
  const [showModal, setShowModal] = useState(false);
  const [editMode, setEditMode] = useState(false);
  const [zoneData, setZoneData] = useState({
    id: '',
    nom: '',
    ville: null,
  });

  useEffect(() => {
    fetchZones();
  }, []);

  const fetchZones = async () => {
    try {
      const response = await axios.get('/api/zones'); // Replace with your API endpoint
      setZones(response.data);
    } catch (error) {
      console.error(error);
    }
  };

  const saveZone = async () => {
    try {
      if (editMode) {
        await axios.put(`/api/zones/${zoneData.id}`, zoneData); // Replace with your API endpoint
      } else {
        await axios.post('/api/zones', zoneData); // Replace with your API endpoint
      }
      fetchZones();
      closeModal();
    } catch (error) {
      console.error(error);
    }
  };

  const deleteZone = async (id) => {
    try {
      await axios.delete(`/api/zones/${id}`); // Replace with your API endpoint
      fetchZones();
    } catch (error) {
      console.error(error);
    }
  };

  const openModal = (data = null) => {
    setZoneData(data || { id: '', nom: '', ville: null });
    setEditMode(!!data);
    setShowModal(true);
  };

  const closeModal = () => {
    setShowModal(false);
    setZoneData({ id: '', nom: '', ville: null });
    setEditMode(false);
  };

  return (
    <div>
      <Button variant="primary" onClick={() => openModal()}>
        Add Zone
      </Button>

      <Table striped bordered hover>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {zones.map((zone) => (
            <tr key={zone.id}>
              <td>{zone.id}</td>
              <td>{zone.nom}</td>
              <td>
                <Button
                  variant="info"
                  onClick={() => openModal(zone)}
                  style={{ marginRight: '5px' }}
                >
                  Edit
                </Button>
                <Button variant="danger" onClick={() => deleteZone(zone.id)}>
                  Delete
                </Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>

      <Modal show={showModal} onHide={closeModal}>
        <Modal.Header closeButton>
          <Modal.Title>{editMode ? 'Edit Zone' : 'Add Zone'}</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <Form>
            <Form.Group controlId="formZoneName">
              <Form.Label>Name</Form.Label>
              <Form.Control
                type="text"
                placeholder="Enter zone name"
                value={zoneData.nom}
                onChange={(e) =>
                  setZoneData({ ...zoneData, nom: e.target.value })
                }
              />
            </Form.Group>
          </Form>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={closeModal}>
            Cancel
          </Button>
          </Modal.Footer>
          </Modal>

        </div>
    );
};

export default Zone
